export class Reorder {
    constructor() {
        this.custom = true;
    }
    componentWillLoad() {
        this.custom = this.el.childElementCount > 0;
    }
    hostData() {
        const hostClasses = {
            'reorder-custom': this.custom
        };
        return {
            class: hostClasses
        };
    }
    render() {
        return (this.custom)
            ? h("slot", null)
            : h("ion-icon", { class: 'reorder-icon', name: 'reorder' });
    }
    static get is() { return "ion-reorder"; }
    static get host() { return { "theme": "reorder" }; }
    static get properties() { return { "el": { "elementRef": true } }; }
    static get style() { return "/**style-placeholder:ion-reorder:**/"; }
    static get styleMode() { return "/**style-id-placeholder:ion-reorder:**/"; }
}
